import React from "react";
// import {  MDBContainer } from "mdbreact";
import './footer.css';
// import Col from 'react-bootstrap/Col';
const FooterPage = () => {
  return (
    <section className="fly">
    <footer>
    <ul className="soc">
    <li className="ft"><ion-icon style={{'color':'black', 'padding':'10px', 'height':50, 'width':20}} name="logo-facebook"></ion-icon></li> 
    
    <li className="ft"><ion-icon style={{'color':'black', 'padding':'10px', 'height':50, 'width':20}} name="logo-twitter"></ion-icon></li> 

 <li className="ft"> <ion-icon style={{'color':'black', 'padding':'10px', 'height':50, 'width':20}} name="logo-linkedin"></ion-icon> </li>

 <li> <ion-icon style={{'color':'black', 'padding':'10px', 'height':50, 'width':20}} name="logo-instagram"></ion-icon> </li>
</ul>

   
  
         
        
        
      

  
</footer>
   </section>   
      
  );
}

export default FooterPage;
